import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return (<ul>
        <li>Learn react</li>
        <li>Learn docker</li>
        <li>Learn AWS</li>
    </ul>);
};

const AppHeader = () => {
    return <h1>My todo list</h1>;
};

const SearchPanel = () => <input placeholder="search"/>;

const TodoListApp = () => {
    return (
        <div>
            <AppHeader/>
            <SearchPanel/>
            <TodoList/>
        </div>);
};

ReactDOM.render(<TodoListApp/>, document.getElementById('root'));
